import React from 'react'
import CardList from './CardList'
import SearchBox from './SearchBox'
import {details} from './details'

const App = () => {

	return (
		<div className="tc">
			<div><h1>RoboFriends</h1></div>
			<SearchBox />
			<CardList details={details}/>
		</div>
	);


} 

export default App;
